	$MainForm_Load={
	#TODO: Initialize Form Controls here
	Import-Module ActiveDirectory
	}
	
	
	
	
	
	$btnExtend_Click={
		#TODO: Place custom script here
		
		
		[array]$users = ($txtUser.Text).Split(",") | % { $_.Trim() }
		
		foreach ($user in $users)
		{
			
			Try{
			Get-ADUser $user | Set-ADAccountControl -PasswordNeverExpires $false
			$TargetUser = Get-ADUser -Filter { sAMAccountName -eq $user }
			$uObj = [ADSI]"LDAP://$TargetUser"
			$uObj.put("pwdLastSet", 0)
			$uObj.SetInfo()
			$uObj.put("pwdLastSet", -1)
			$uObj.SetInfo()
				
			$lblError.Text = "Password(s) Expiration successfully extended"
			}
			Catch
			{
			$lblError.Text = $_.Exception.Message	
			}
		}
	}
	
